	'messages:move-page-legend' => 'bs:Premjesti stranicu',
	'messages:movepagetext' => 'bs:Korištenjem ovog formulara možete preimenovati stranicu, premještajući cijelu historiju na novo ime.
Članak pod starim imenom postat će stranica koja preusmjerava na članak pod novim imenom. 
Možete automatski izmijeniti preusmjerenje do izvornog naslova.
Ako se ne odlučite na to, provjerite [[Special:DoubleRedirects|dvostruka]] ili [[Special:BrokenRedirects|neispravna preusmjeravanja]].
Dužni ste provjeriti da svi linkovi i dalje nastave voditi na prave stranice.

Imajte na umu da članak <strong>neće</strong> biti premješten ako već postoji članak pod imenom na koje ga namjeravate preusmjeriti osim u slučaju stranice za preusmjeravanje koja nema nikakvih starih izmjena.
To znači da možete vratiti stranicu na prethodno mjesto ako pogriješite, ali ne možete zamijeniti postojeću stranicu.

<strong>Napomena:</strong>
Ovo može biti drastična i neočekivana promjena kad su u pitanju popularne stranice.
Molimo da dobro razmislite prije no što premjestite stranicu.',
	'messages:movepagetext-noredirectfixer' => 'bs:Koristeći donji obrazac, preimenovat ćete stranicu i premjestiti cijelu njenu historiju na novi naziv.
Stari naziv postat će preusmjerenje na novi naziv.
Molimo da provjerite postoje li [[Special:DoubleRedirects|dvostruka]] ili [[Special:BrokenRedirects|nedovršena preusmjerenja]].
Vi ste za to odgovorni te morate provjeriti jesu li linkovi ispravni i vode li tamo kamo bi trebali voditi.

Imajte na umu da stranica \'\'\'neće\'\'\' biti premještena ako već postoji stranica s tim imenom, osim ako je prazna ili je preusmjerenje ili nema ranije historije.
Ovo znači da možete preimenovati stranicu nazad gdje je ranije bila preimenovana ako ste pogriješili, ali ne možete ponovo preimenovati postojeću stranicu.

<strong>Napomena:</strong>
