	'messages:api-help-no-extended-description' => 'en:',
	'messages:api-help-authmanager-general-usage' => 'en:The general procedure to use this module is:
# Fetch the fields available from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$4</kbd>, and a <kbd>$5</kbd> token from <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.
# Present the fields to the user, and obtain their submission.
# Post to this module, supplying <var>$1returnurl</var> and any relevant fields.
# Check the <samp>status</samp> in the response.
#* If you received <samp>PASS</samp> or <samp>FAIL</samp>, you\'re done. The operation either succeeded or it didn\'t.
#* If you received <samp>UI</samp>, present the new fields to the user and obtain their submission. Then post to this module with <var>$1continue</var> and the relevant fields set, and repeat step 4.
#* If you received <samp>REDIRECT</samp>, direct the user to the <samp>redirecttarget</samp> and wait for the return to <var>$1returnurl</var>. Then post to this module with <var>$1continue</var> and any fields passed to the return URL, and repeat step 4.
#* If you received <samp>RESTART</samp>, that means the authentication worked but we don\'t have a linked user account. You might treat this as <samp>UI</samp> or as <samp>FAIL</samp>.',
	'messages:api-help-authmanagerhelper-requests' => 'en:Only use these authentication requests, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> or from a previous response from this module.',
	'messages:api-help-authmanagerhelper-request' => 'en:Use this authentication request, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd>.',
	'messages:api-help-authmanagerhelper-messageformat' => 'en:Format to use for returning messages.',
	'messages:api-help-authmanagerhelper-mergerequestfields' => 'en:Merge field information for all authentication requests into one array.',
	'messages:api-help-authmanagerhelper-preservestate' => 'en:Preserve state from a previous failed login attempt, if possible.',
	'messages:api-help-authmanagerhelper-returnurl' => 'en:Return URL for third-party authentication flows, must be absolute. Either this or <var>$1continue</var> is required.

Upon receiving a <samp>REDIRECT</samp> response, you will typically open a browser or web view to the specified <samp>redirecttarget</samp> URL for a third-party authentication flow. When that completes, the third party will send the browser or web view to this URL. You should extract any query or POST parameters from the URL and pass them as a <var>$1continue</var> request to this API module.',
	'messages:api-help-authmanagerhelper-continue' => 'en:This request is a continuation after an earlier <samp>UI</samp> or <samp>REDIRECT</samp> response. Either this or <var>$1returnurl</var> is required.',
	'messages:api-help-authmanagerhelper-additional-params' => 'en:This module accepts additional parameters depending on the available authentication requests. Use <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> (or a previous response from this module, if applicable) to determine the requests available and the fields that they use.',
