	'messages:config-welcome' => 'en:MediaWiki is a free and open-source wiki software package written in PHP. It serves as the platform for Wikipedia and the other Wikimedia projects, used by hundreds of millions of people each month. MediaWiki is localised in over 350 languages and its reliability and robust feature set have earned it a large and vibrant community of third-party users and developers.
=== Environmental checks ===
Basic checks will now be performed to see if this environment is suitable for MediaWiki installation.
Remember to include this information if you seek support on how to complete the installation.',
